/**
 * Returns an automaton that accepts the union of the languages of the given
 * automata.
 * <p>
 * Complexity: linear in number of states.
 */
public static Automaton union(Automaton a1, Automaton a2) {
  return union(Arrays.asList(a1, a2));
}

